      name : 'Ganesh',
      sirname: 'vibhute'
    })
  return (
    <div>      
    <userContext.Provider value={sola}> 
      <FirstInfo.Provider value={info}><Recive/></FirstInfo.Provider>      
    </userContext.Provider>       
      </div>
  )
}

